import React from 'react';
import './App.css';
import SimpleCard from './Card';
import { Grid } from '@material-ui/core';

function App() {
  return (
    <Grid container spacing={1} className="App">
      <Grid item>
        <SimpleCard />
      </Grid>
      <Grid item>
        <SimpleCard />
      </Grid>
      <Grid item>
        <SimpleCard />
      </Grid>
      <Grid item>
        <SimpleCard />
      </Grid>
      <Grid item>
        <SimpleCard />
      </Grid>
    </Grid>
  );
}

export default App;
